import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import App from "./App";
import './main.css';

function Main() {
  return (
    <Router>
      <div className="App">
        <header className="navbar">
          <nav>
            <ul className="nav-links">
              <li>Home</li>
              <li>About</li>
              <li>Feedback</li>
            </ul>
            <div className="profile-icon">ðŸ‘¤</div>
          </nav>
        </header>

          <Routes>
            <Route path="/" element={<App />} />
          </Routes>
      

        <footer className="footer">
          <p>Footer</p>
        </footer>
      </div>
    </Router>
  );
}

export default Main;
